import React from "react";
import "../src/css/upi.css";
function Upi() {
  return (
    <div className="upi">
      <div className="iupi">
        <form>
          <div>AMOUNT : 20</div>
          <div>
            <input type="text" placeholder="ENTER YOUR UPI ID" />
          </div>
          <div>
            <button>SUBMIT</button>
          </div>
          <div>STATUS</div>
        </form>
      </div>
    </div>
  );
}
export default Upi;
